enum Education {
  Others,
  SD,
  SMP,
  SMA,
  KuliahS1,
  KuliahS2,
}

function convertEducationToString(education: Education) string {
  switch (education) {
    case Education.SD:
      return "SD";
    case Education.SMP:
      return "SMP";
    case Education.SMA:
      return "SMA";
    case Education.KuliahS1:
      return "Strata 1";
    case Education.KuliahS2:
      return "Strata 2";
    case Education.Others:
    default:
      return "Lainnya";
  }
}

